  console.log("fetchData depuis activeProfil");
  console.log(fetchData);

  //JSX
  return (
    <div className="profile__container">
      <div className="profile__card--user">
        <div className="user__img"></div>
        <div className="user__name">
          <h2>{fetchData[0].name}</h2>
        </div>
        <div className="user__job">
          <h2>{fetchData[0].job}</h2>
        </div>
        <h2>Ma Biographie</h2>
        <div className="user__description">
          <p>{fetchData[0].bio}</p>
        </div>
      </div>
    </div>
  );
};

export default ActiveProfil;
